package flowcontrol;

import java.util.Scanner;

public class whilee {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    Scanner s=new Scanner(System.in);
    int j=s.nextInt();
    
    while(j<10)
    {
    	System.out.println(j);
    	j=j+1;
    	
    }
    
	
	}
	}


